            t2cfunc::distribute(matrix_yz, buffer_yz, -8.0 * 3.0 * f4_5, gto_indexes, 4, 6, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_zz, buffer_zz, -8.0 * 24.0, gto_indexes, 4, 4, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_zz, buffer_zz, -8.0 * 3.0 * f4_5, gto_indexes, 4, 6, j, ket_first, ket_last);

            // compute primitive integrals block (ZZZZ_YZZZ)

