            t2cfunc::distribute(matrix_xx, buffer_xx, 8.0 * 8.0, gto_indexes, 4, 4, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_xy, buffer_xy, 8.0 * 8.0, gto_indexes, 4, 4, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_xz, buffer_xz, 8.0 * 8.0, gto_indexes, 4, 4, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_yy, buffer_yy, 8.0 * 8.0, gto_indexes, 4, 4, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_yz, buffer_yz, 8.0 * 8.0, gto_indexes, 4, 4, j, ket_first, ket_last);

            t2cfunc::distribute(matrix_zz, buffer_zz, 8.0 * 8.0, gto_indexes, 4, 4, j, ket_first, ket_last);
